import React from 'react'
import ProfilePicture from './ProfilePicture'

const PostHeader = props => {
  const { profile_image, name } = props
  return(
    <div>
      <ProfilePicture src={profile_image} />

      <span>{props.name}</span>
    </div>
  )
}

export default PostHeader
